contracts/HelloWorld.sol.content:
pragma solidity 0.7.5;


contract HelloWorld {

    // "State" variables preserve the state of the variable.
    string message;

    constructor(string memory _message){  //User or computer Input into _message then set the initial "message" state to _message
        message = _message;
    }

    function Hello(int number) public view returns(string memory){  
        if(number == 10){
            return message;
        } 
        else{
            return "Wrong number";
        }
        return message;
    }
}

